50	Our Journey to Daisy	\\	We were having dinner before going to see a movie. Cameron looked up from across the table and said, "Well when we have dogs..." and my brain forgot to keep listening. We had only been dating for about a month at that point, but we had talked extensively about our love of dogs and my heart leapt at the confirmation that we both felt the certainty: not if, but when.\r\n\r\nFlash forward a year and we were living together in Seattle with two cats, Luke and Han (named by him). Cameron was scouring PetFinder at every chance looking for our perfect pup.  Then one day, we came across Hank. Hank was a 6 year old pitbull assured to be good with dogs, cats, kids, and all sorts of environments. He tried to eat Luke on Day 2 and we quickly realized that our one bedroom apartment was not going to be conducive to Hank's needs or our cats' safety with his increased prey drive. Hank now lives just outside Portland, Oregon on an actual farm (no euphemisms here) with a pitty brother, loads of room to run, and gates between him and all small animals.\r\n\r\nThree months later we signed up to foster Tammy, a six year old German Shepherd who had grown up with cats and was getting passed over because she was a senior dog. We checked off the "good with cats" requirement and breathed a sigh of relief - until we had to take her potty. Seattle is a lovely city for dogs who like dogs. Tammy did not like dogs. \r\n\r\nWe spent four months fostering Tammy while we found her a home in the suburbs. Her dog reactivity was terrifying in a city where you could bump into a dog in the elevator and at every corner. The head of security in our building knew our struggle well, and after just a few weeks of getting to know Tammy, he fell in love and whisked her away to a quiet street with minimal dogs far away from the hustle and bustle of downtown Seattle.\r\n\r\nCameron and I were pretty devastated. We found out we made great fosters, but when would we find OUR dog? What mistakes were we making? It took us a year and a half to give it another shot, and that's when Daisy came into our lives.\r\n\r\nWe partnered with Big Dog Rescue Project, a non-profit that rescues dogs from Texas and takes them to the Pacific Northwest or New Jersey (they have volunteers there). They knew our tale and our reservations: cat friendly, dog friendly, happy in apartment living, doesn't need to be whisked away by folks who have way more land than we do. Daisy was three months old when they called to say they found the one! They described her as calm and sleepy. She was the dog who didn't look up when the other dogs were barking. She was the runt of her litter of three. She was very, very goofy looking. She was perfect.\r\n\r\nOn December 16, 2020, we picked her up at the Seattle Tacoma Airport and marveled at her tiny paws and baby face. It wouldn't take long for that sweet angel baby to start earning one of her many nicknames: Daisy the Destroyer. This dog, though, was here to stay.	2024-10-03 02:48:24.379739-05	t
51	Puppy Jail Woes	\\	Every Tuesday night, Cameron, Daisy, and I would take in a big deep breath and think "okay, today's the day it goes well" and every Tuesday night, we were proven wrong.\r\n\r\nWe signed Daisy up for puppy socialization classes immediately after we got her and started taking her to group puppy classes as well. The socialization classes were one big play time supervised by trainers at the local positive reinforcement facility we had found. Imagine little paws, occasional pee puddles, and lots of running. In the corner of your imaginary room, add a barrier that blocked that corner from the rest of the puppies. That's where Daisy would find herself every Tuesday night.\r\n\r\nAs sweet as she looked, she was an actual land shark. All teeth and no reservations, Daisy flung herself head first at every dog within ten feet of her. She loved other dogs the way a teenage girl in the early 2010's loved the Jonas Brothers and One Direction (I was that teenage girl). Instead of politely asking other puppies to play and taking turns, Daisy would rile everybody up, including herself, and promptly find herself in puppy jail after one too many rude body slams to her fellow playmates. It was both hilarious and heartbreaking.\r\n\r\nOur puppy classes were even worse. Six puppies and their owners would file in to the room and take their spot on the mat. Five of those puppies would snuggle into their owners waiting to hear the exciting click of a job well done followed by a treat. One of those puppies would transform into a sled dog and put all of their might into pulling towards the potential dog friends. Take a guess at who I am describing.\r\n\r\nAt each of these sessions, the trainers tried yet again to take Daisy from us to try to show us "how it's done" except that in a wild turn of events, it truly wasn't us. We made it three loud, disruptive sessions before the owner calmly suggested we do private training with her instead. I still can't decide years later if I was comforted that the trainers also couldn't get her under control or filled with utter despair.\r\n\r\nThe owner, Cheryl, became our best friend for the next nine months. While Daisy was probably bummed that there were now zero dogs in sight when we arrived to training, she was also ecstatic that private training had one guarantee: no more puppy jail.	2024-10-03 02:51:11.000534-05	t
52	Baloo the Boyfriend	\\	You know when you're watching a rom com and the protagonists make eye contact just as the music changes to something soft and romantic? I witnessed that moment between Daisy and Baloo, a great Dane puppy that had lived on our floor for about 6 months. There were 3 or 4 other dogs around, and we were patiently (as patiently as a 6 month old Daisy could muster) waiting to enter the doggy enclosure in our apartment building. Baloo turned his head from the other side of the glass and it's like all the other dogs melted away. It was genuinely love at first sight.\r\n\r\nI had gotten to know the owners before they switched floors and hadn't seen them or Baloo in a while. We were all astonished at the way they pawed at each other from either sides of the glass. It was a bizarre sight - both dogs had gotten used to seeing other dogs waiting or in the enclosure and neither had ever been drawn to another dog like that before.\r\n\r\nThe butterflies never stopped for Daisy. One whiff of Baloo around the corner and her full body wiggles would begin before she even laid eyes on him. They could play for hours if we let them. Baloo being the giant that he was and Daisy being an absolute menace, we would all drop the leashes immediately when we saw each other because everyone was safer if we just let them crash into each other to begin their games.\r\n\r\nAt the time, we were still frequenting the dog park every now and then to help with Daisy's over-excitement. We'd work on getting her to be calm approaching the park, not getting overstimulated while at the park, and then try to take her to watch the park from a distance. It was almost always a disaster and we haven't stepped foot in a dog park in about three years. On one particular day, though, we ran into Baloo! At first, it was like running into your teacher when you're in elementary school: exciting but really weird. Both dogs seemed awkward with each other, like they were deciding if they were ready for PDA or not.\r\n\r\nWhat ensued was the longest game of tug I have ever witnessed. Daisy was determined to win at all costs. Baloo was forced to decide if he let her win or if he risked angering his special lady. Daisy won. They never played tug again. \r\n\r\nWe moved to California a few months after the public doggy date, and I always wonder if Daisy thinks of Baloo. She's made more friends here, and has some preferred play mates at different day cares, but deep down I like to believe that Baloo still has a little piece of her heart. 	2024-10-03 02:53:01.610699-05	t
